import "./Heroimgstyling.css";

import React from "react";
import HEh from "..../assets/profbest.jpg";

const Heroimg = () => {
  return (
    <div className="Hero">
      <div className="mask">
        <img className="intoimg" src={HEh} />
      </div>
    </div>
  );
};

export default Heroimg;
